    "View child items": "\u041f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u043f\u0456\u0434\u043b\u0435\u0433\u043b\u0456 \u0435\u043b\u0435\u043c\u0435\u043d\u0442\u0438",
